import { BrowserRouter as Router } from "react-router-dom";
import Route from "react-router-dom/Route";
import React from "react";
import Home from "./components/home/Homepage";
import SignInSide from "./components/authentication/Login";
import Signup from "./components/registeration/signup";
import Loginpage from "./components/adminPage/profileDetails/Loginadmin";
import Filters from "./components/adminPage/filters/Filters";
import Cardgrid from "./components/adminPage/cardDetails/Cardsgrid";
import { Card } from "@material-ui/core";
import Forgot from "./components/registeration/Forgotpassword";
import Contact from "./components/home/Contact";
import Navbar from "./components/home/Navbar";
import Profile from "./components/adminPage/profileDetails/ProfilePage";

const Roouter = () => {
  return (
    <Router>
      <div>
        <Route
          path="/"
          exact
          render={() => {
            return (
              <div>
                {/* <Homecontent /> */}
                <Home />
              </div>
            );
          }}
        />
        <Route
          path="/contact"
          exact
          render={() => {
            return (
              <div>
                <Navbar />
                <Contact />
              </div>
            );
          }}
        />

        <Route
          path="/login"
          exact
          render={() => {
            return (
              <div>
                <SignInSide />
              </div>
            );
          }}
        />

        <Route
          path="/signup"
          exact
          render={() => {
            return <Signup />;
          }}
        />

        <Route
          path="/loginpage"
          exact
          render={() => {
            return (
              <div>
                <Loginpage />
                <Filters />
                <Cardgrid />
              </div>
            );
          }}
        />
        <Route
          path="/forgot"
          exact
          render={() => {
            return (
              <div>
                <Profile />
              </div>
            );
          }}
        />
      </div>
    </Router>
  );
};

export default Roouter;
